import React from 'react';
import { SimpleGrid, Heading, Image } from "@chakra-ui/react";
import SB1 from './SB1.jpg';
import SB2 from './SB2.jpg';
import SB3 from './SB3.jpg';
import SB4 from './SB4.jpg';

const SB = () => {
  return (
    <div>

      <Heading
      size = 'xl'
      position = 'relative'
      fontFamily = 'monospace'
      top = '0px'>
        Santa Barbara
      </Heading>

      <SimpleGrid columns={2} spacing="40px">

        <Image
          position = 'relative'
          src = {SB1}
          alt = "SB1"
        />

        <Image
          position = 'relative'
          src = {SB2}
          alt = "SB2"
        />

        <Image
          position = 'relative'
          src = {SB3}
          alt = "SB3"
        />

        <Image
          position = 'relative'
          src = {SB4}
          alt = "SB4"
        />

      </SimpleGrid>

    </div>
  )
};

export default SB;
